import React, { useEffect, useState } from 'react'
import Player from '../../models/Player';
import Dado from '../../components/Dado';

function Home(props) {

    const [ dado, setDado ] = useState(new Dado());

    useEffect(() => {
        let d = new Dado();
        d.jogarDado();
        setDado(d);
    }, [] )

    function jogarDado() {
        let d = new Dado();
        d.jogarDado();
        setDado(d);
    }

    return (<>
        <div className="col-xl-12 mt-3">
            {dado.getNumero() && (
                <Dado dado={dado} />
            )}
        </div>
    </>)
}

export default Home;
